import React, {useState} from 'react'
import { useEffect } from 'react';

const Test1 = () => {

    const [rows, setRows] = useState([]);

    const api = `http://127.0.0.1:8000`;

    useEffect(() => {
        fetch(api)
        .then((res) => res.json())
        .then((data) => {
            console.log(data);
            setRows(data);
        });
    },[]);

    return (
        <div>
            {rows.map(row => <div>{row.title}</div>)}
        </div>
    )}

export default Test1
